import React, { Component } from 'react';
import { Grid, Cell} from 'react-mdl';

class Skills extends Component {
  render() {
    return(
      <Grid>
        <Cell col={12}>
          <div style={{display: 'flex'}}></div>
        </Cell>
      </Grid>
    )
  }
}

export default Skills;
